import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

const Tarefa = ({ tarefa, onPress }) => {
  return (
    <View>
      <Text>{tarefa.nome}</Text>
      <TouchableOpacity onPress={onPress}>
        <Text>Ver detalhes</Text>
      </TouchableOpacity>
    </View>
  );
};

export default Tarefa;
